<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>FB_AUS_SN AA_I_240529 - Advanced Visualization</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            display: flex;
            flex-direction: column;
        }
        
        .header {
            background: rgba(255, 255, 255, 0.95);
            padding: 20px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            backdrop-filter: blur(10px);
        }
        
        .header h1 {
            color: #2d3748;
            font-size: 28px;
            margin-bottom: 10px;
        }
        
        .statistics {
            display: flex;
            gap: 30px;
            color: #718096;
            font-size: 14px;
        }
        
        .stat {
            display: flex;
            align-items: center;
            gap: 8px;
        }
        
        .stat-value {
            font-weight: bold;
            color: #4a5568;
        }
        
        .controls {
            background: rgba(255, 255, 255, 0.95);
            padding: 20px;
            box-shadow: 0 -4px 6px rgba(0, 0, 0, 0.1);
            backdrop-filter: blur(10px);
        }
        
        .control-group {
            margin-bottom: 20px;
        }
        
        .control-label {
            font-weight: 600;
            color: #2d3748;
            margin-bottom: 10px;
            display: block;
        }
        
        .layer-toggles {
            display: flex;
            flex-wrap: wrap;
            gap: 10px;
        }
        
        .layer-toggle {
            background: white;
            border: 2px solid #e2e8f0;
            border-radius: 8px;
            padding: 8px 16px;
            cursor: pointer;
            transition: all 0.3s ease;
            display: flex;
            align-items: center;
            gap: 8px;
        }
        
        .layer-toggle:hover {
            transform: translateY(-2px);
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }
        
        .layer-toggle.active {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            border-color: transparent;
        }
        
        .layer-color {
            width: 20px;
            height: 20px;
            border-radius: 4px;
            border: 1px solid rgba(0, 0, 0, 0.2);
        }
        
        .view-modes {
            display: flex;
            gap: 10px;
        }
        
        .view-mode {
            padding: 10px 20px;
            background: white;
            border: 2px solid #e2e8f0;
            border-radius: 8px;
            cursor: pointer;
            transition: all 0.3s ease;
            font-weight: 500;
        }
        
        .view-mode:hover {
            background: #f7fafc;
        }
        
        .view-mode.active {
            background: #4a5568;
            color: white;
            border-color: #4a5568;
        }
        
        .viewer {
            flex: 1;
            display: flex;
            justify-content: center;
            align-items: center;
            padding: 20px;
            position: relative;
            overflow: auto;
        }
        
        .canvas-container {
            position: relative;
            background: white;
            border-radius: 12px;
            box-shadow: 0 20px 25px -5px rgba(0, 0, 0, 0.1), 0 10px 10px -5px rgba(0, 0, 0, 0.04);
            overflow: hidden;
            max-width: 95%;
            max-height: 95%;
        }
        
        .canvas-stack {
            position: relative;
            display: block;
        }
        
        .canvas-layer {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: auto;
            transition: opacity 0.3s ease;
        }
        
        .canvas-layer.hidden {
            opacity: 0;
            pointer-events: none;
        }
        
        .base-image {
            position: relative;
            width: 100%;
            height: auto;
            display: block;
        }
        
        .zoom-controls {
            position: absolute;
            top: 20px;
            right: 20px;
            display: flex;
            flex-direction: column;
            gap: 10px;
            background: rgba(255, 255, 255, 0.95);
            padding: 10px;
            border-radius: 8px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }
        
        .zoom-btn {
            width: 40px;
            height: 40px;
            border: none;
            background: #4a5568;
            color: white;
            border-radius: 8px;
            cursor: pointer;
            font-size: 20px;
            transition: all 0.3s ease;
        }
        
        .zoom-btn:hover {
            background: #2d3748;
            transform: scale(1.1);
        }
        
        .legend {
            position: absolute;
            top: 20px;
            left: 20px;
            background: rgba(255, 255, 255, 0.95);
            padding: 15px;
            border-radius: 8px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            max-width: 250px;
        }
        
        .legend-title {
            font-weight: 600;
            color: #2d3748;
            margin-bottom: 10px;
            padding-bottom: 10px;
            border-bottom: 1px solid #e2e8f0;
        }
        
        .legend-item {
            display: flex;
            align-items: center;
            gap: 8px;
            margin-bottom: 8px;
            font-size: 14px;
            color: #4a5568;
        }
        
        .legend-color {
            width: 16px;
            height: 16px;
            border-radius: 3px;
            border: 1px solid rgba(0, 0, 0, 0.2);
        }
        
        @media (max-width: 768px) {
            .layer-toggles {
                flex-direction: column;
            }
            
            .legend {
                position: static;
                margin-bottom: 20px;
                max-width: 100%;
            }
            
            .zoom-controls {
                top: 10px;
                right: 10px;
            }
        }
    </style>
</head>

            </div>
        </div>
        
        <div class="legend" id="legend">
            <div class="legend-title">Element Legend</div>
            
        </div>
        
        <div class="zoom-controls">
            <button class="zoom-btn" onclick="zoomIn()">+</button>
            <button class="zoom-btn" onclick="zoomOut()">-</button>
            <button class="zoom-btn" onclick="resetZoom()">‚ü≤</button>
        </div>
    </div>
    
    <div class="controls">
        <div class="control-group">
            <label class="control-label">View Mode</label>
            <div class="view-modes">
                <button class="view-mode active" onclick="setViewMode('base')">Base Plan</button>
                <button class="view-mode" onclick="setViewMode('overlay')">With Overlays</button>
                <button class="view-mode" onclick="setViewMode('custom')">Custom Layers</button>
            </div>
        </div>
        
        <div class="control-group" id="layerControls">
            <label class="control-label">Toggle Layers</label>
            <div class="layer-toggles">
                
            </div>
        </div>
    </div>
    
    <script>
        let currentZoom = 1;
        let currentMode = 'base';
        let activeLayers = new Set();
        
        function setViewMode(mode) {
            currentMode = mode;
            
            // Update button states
            document.querySelectorAll('.view-mode').forEach(btn => {
                btn.classList.toggle('active', btn.textContent.toLowerCase().includes(mode));
            });
            
            // Update layer visibility
            const layers = document.querySelectorAll('.canvas-layer');
            const layerControls = document.getElementById('layerControls');
            
            if (mode === 'base') {
                layers.forEach(layer => layer.classList.add('hidden'));
                layerControls.style.display = 'none';
            } else if (mode === 'overlay') {
                layers.forEach(layer => layer.classList.remove('hidden'));
                layerControls.style.display = 'none';
            } else if (mode === 'custom') {
                layers.forEach(layer => {
                    const elementType = layer.dataset.element;
                    layer.classList.toggle('hidden', !activeLayers.has(elementType));
                });
                layerControls.style.display = 'block';
            }
        }
        
        function toggleLayer(elementType) {
            if (currentMode !== 'custom') {
                setViewMode('custom');
            }
            
            const layer = document.getElementById('layer-' + elementType.replace(/s+/g, '-'));
            const button = document.querySelector(`[data-layer="${elementType}"]`);
            
            if (activeLayers.has(elementType)) {
                activeLayers.delete(elementType);
                layer.classList.add('hidden');
                button.classList.remove('active');
            } else {
                activeLayers.add(elementType);
                layer.classList.remove('hidden');
                button.classList.add('active');
            }
        }
        
        function zoomIn() {
            currentZoom = Math.min(currentZoom * 1.2, 5);
            applyZoom();
        }
        
        function zoomOut() {
            currentZoom = Math.max(currentZoom / 1.2, 0.5);
            applyZoom();
        }
        
        function resetZoom() {
            currentZoom = 1;
            applyZoom();
        }
        
        function applyZoom() {
            const container = document.getElementById('canvasContainer');
            container.style.transform = `scale(${currentZoom})`;
        }
        
        // Initialize
        setViewMode('base');
        
        // Keyboard shortcuts
        document.addEventListener('keydown', (e) => {
            if (e.key === '1') setViewMode('base');
            else if (e.key === '2') setViewMode('overlay');
            else if (e.key === '3') setViewMode('custom');
            else if (e.key === '+' || e.key === '=') zoomIn();
            else if (e.key === '-') zoomOut();
            else if (e.key === '0') resetZoom();
        });
    </script>
